/*
 * UCS2   : use 2 bytes to encode a unicode character.
 * UTF-16 : 2 or 4 bytes, but its code unit is 2 bytes. it has surrogate pair to encode [0x010000 , 0x10FFFF].
 *
 * Here take ucs2 as a subset of utf16.
 *
 * UTF-16 use surrogate pair to encoding [0x010000 , 0x10FFFF];
 * surrogate pair range are [0xD800, 0xDBFF] (surrogate high 10 bits) and [0xDC00, 0xDFFF] (surrogate low 10 bits);
 *
 * EX: unicode character [0x0000 , 0x10FFFF]
 * Unicode Character  (U+4E01):
 *     UTF-8  Encoding: 0xE4 0xB8 0x81
 *     UTF-16 Encoding: 0x4E01
 *     UTF-32 Encoding: 0x00004E01
 *
 * Unicode Character  (U+2A704):
 *     UTF-8  Encoding: 0xF0 0xAA 0x9C 0x84
 *     UTF-16 Encoding: 0xD869 0xDF04
 *     UTF-32 Encoding: 0x0002A704
 */
#define SURROG_BASE       0x010000

typedef struct st_utf16 {
    uint16 code[2];
    uint16 code_units;  // number of UTF-16 code units: 1 for BMP; 2 for surrogate pair;
} utf16_t;

